import React, { Component } from "react";
import { withRouter, NavLink } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { registerUser } from "../../actions/authActions";
import classnames from "classnames";

import compose from 'recompose/compose';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import FormControl from '@material-ui/core/FormControl';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import LockIcon from '@material-ui/icons/LockOutlined';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import withStyles from '@material-ui/core/styles/withStyles';

import axios from 'axios';
const styles = theme => ({
  layout: {
    width: 'auto',
    display: 'block', // Fix IE11 issue.
    marginLeft: theme.spacing.unit * 3,
    marginRight: theme.spacing.unit * 3,
    [theme.breakpoints.up(400 + theme.spacing.unit * 3 * 2)]: {
      width: 400,
      marginLeft: 'auto',
      marginRight: 'auto'
    }
  },
  paper: {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    padding: theme.spacing.unit * 4,
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    width: theme.spacing.unit * 50,
    backgroundColor: 'theme.palette.background.paper',
    boxShadow: theme.shadows[5]
  },
  avatar: {
    margin: theme.spacing.unit,
    backgroundColor: theme.palette.secondary.main
  },
  submit: {
    marginTop: theme.spacing.unit * 3
  },
  link: {
    textDecoration: 'none'
  },
  footer: {
    marginTop: theme.spacing.unit * 2
  },
  errorText: {
    color: '#D50000',
    marginTop: '5px'
  },
  successText: {
    color: '#32971E',
    marginTop: '10px',
    textDecoration: 'none'
  }
});
class Register extends Component {
  constructor() {
    super();
    this.state = {
      name: "",
      email: "",
      cles: "",
      password: "",
      password2: "",
      errors: {},
      persons: []
    };
  }

  componentDidMount() {
    axios.get(`http://localhost:5000/api/users/entreprise`)
      .then(res => {
        const persons = res.data;
        console.log("ity ny get entreprise lesy dada ah " + persons)
        this.setState({ persons });
      })
    // If logged in and user navigates to Register page, should redirect them to dashboard
    if (this.props.auth.isAuthenticated) {
      this.props.history.push("/dashboard");
    }
  }

  componentWillReceiveProps(nextProps) {
    if (nextProps.errors) {
      this.setState({
        errors: nextProps.errors
      });
    }
  }

  onChange = e => {
    this.setState({ [e.target.name]: e.target.value });
  };

  onSubmit = e => {
    e.preventDefault();

    const newUser = {
      name: this.state.name,
      email: this.state.email,
      cles: this.state.cles,
      password: this.state.password,
      password2: this.state.password2
    };

    this.props.registerUser(newUser, this.props.history);
  };

  render() {
    const { classes } = this.props;
    const { errors } = this.state;

    return (
      <div className="container">
        <div class="background-panels">
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
        </div>
        <div class="phone">
          <div class="phone-back">
            <div class="phone-left-side">
              <div class="phone-antena"></div>
              <div class="phone-button top"></div>
              <div class="phone-button"></div>
              <div class="phone-button bottom"></div>
              <div class="phone-antena bottom"></div>
            </div>
            <div class="phone-bottom">
              <div class="phone-antena"></div>
              <div class="bottom-speaker">
                <div></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
              </div>
              <div class="phone-screw">
                <div></div>
              </div>
              <div class="phone-charger">
              </div>
              <div class="phone-screw right">
                <div></div>
              </div>
              <div class="bottom-speaker right">
                <div></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
              </div>
              <div class="phone-antena right"></div>
            </div>
          </div>
          <div class="phone-screen"></div>
          <div class="phone-display">
            <div class="phone-notch">
              <div class="phone-speaker"></div>
            </div>
            <div class="display-content">
              <div class="notifications-bar">
                <div class="time">9:41</div>
                <div class="range"></div>
                <div class="wifi"></div>
                <div class="battery"></div>
              </div>
              <div class="nav">
                <div class="messages"></div>
                <div class="phone-number">+7 (999) 222-22-22</div>
                <div class="menu"></div>
              </div>
              <div class="current-plan">
                <div class="plan">
                  <div>
                    <div class="plan-header">CURRENT PLAN</div>
                    <div class="plan-price"><span>$</span>29.95</div>
                  </div>
                  <div class="plan-date">
                    <div>JAN 28TH</div>
                    <div>FEB 28TH</div>
                  </div>
                </div>
                <div class="text-question">You spend $20 over traffic last month.<br/>Do you want to change plan?</div>
                </div>
                <div class="plan-box">
                  <div class="plan-options">
                    <div>
                      <div>15<span>GB</span></div>
                      <div>Internet</div>
                    </div>
                    <div>
                      <div>1500<span>Mins</span></div>
                      <div>Within Russia</div>
                    </div>
                  </div>
                  <div class="plan-text"><strong>Free calls</strong> within the network</div>
                  <a class="change-plan" href="">Change plan</a>
                </div>
                <div class="plan-list">
                  <div class="plan-limit">
                    <div class="limit-text">
                      <div><strong>$3</strong><span>Until February 28</span></div>
                      <span class="limit-subtext">Unlimited Apps</span>
                    </div>
                    <div class="limit-icon"></div>
                  </div>
                  <div class="plan-limit">
                    <div class="limit-text">
                      <div><strong>$0.15</strong><span>Per SMS</span></div>
                      <span class="limit-subtext">Remove the limit for $1.5</span>
                    </div>
                    <div class="limit-icon upgrade"></div>
                  </div>
                </div>
                <div class="bottom-icons">
                  <div class="chart"><div></div></div>
                  <div class="eye"><div></div></div>
                  <div class="equalizer"><div></div><div></div><div></div></div>
                </div>
                <div class="home-button"></div>
              </div>
            </div>
            <div class="phone-reflections">
              <div class="reflection-1"></div>
              <div class="reflection-2"></div>
              <div class="reflection-3"></div>
              <div class="reflection-4"></div>
              <div class="reflection-5"></div>
              <div class="reflection-6"></div>
              <div class="reflection-7"></div>
            </div>
          </div>
          <React.Fragment>
            <CssBaseline />
            <main className={classes.layout}>
              <Paper className={classes.paper}>
                <Avatar className={classes.avatar}>
                  <LockIcon />
                </Avatar>
                <Typography variant="headline">Cree compte</Typography>
                <form noValidate onSubmit={this.onSubmit}>
                  <FormControl margin="normal" required fullWidth>
                    <InputLabel htmlFor="name">Nom</InputLabel>
                    <Input
                      id="inputFileRegister"
                      onChange={this.onChange}
                      value={this.state.name}
                      error={errors.name}
                      name="name"
                      type="text"
                      className={classnames("", {
                        invalid: errors.name
                      })}
                    />
                    <span className={classes.errorText}>{errors.name}</span>
                  </FormControl>
                  <FormControl margin="normal" required fullWidth>
                    <InputLabel htmlFor="email">Email</InputLabel>
                    <Input
                      id="inputFileRegister"
                      onChange={this.onChange}
                      value={this.state.email}
                      error={errors.email}
                      name="email"
                      type="email"
                      className={classnames("", {
                        invalid: errors.email
                      })}
                    />
                    <span className={classes.errorText}>{errors.email}</span>
                  </FormControl>
                  <FormControl margin="normal" required fullWidth>
                    <InputLabel htmlFor="email">Confirmation entreprise</InputLabel>
                    <Input
                      id="inputFileRegister"
                      onChange={this.onChange}
                      value={this.state.cles}
                      error={errors.cles}
                      name="cles"
                      type="password"
                      className={classnames("", {
                        invalid: errors.cles
                      })}
                    />
                    <span className={classes.errorText}>{errors.cles}</span>
                  </FormControl>
                  <FormControl margin="normal" required fullWidth>
                    <InputLabel htmlFor="password">Mot de passe</InputLabel>
                    <Input
                      id="inputFileRegister"
                      onChange={this.onChange}
                      value={this.state.password}
                      error={errors.password}
                      name="password"
                      type="password"
                      className={classnames("", {
                        invalid: errors.password
                      })}
                    />
                    <span className={classes.errorText}>{errors.password}</span>
                  </FormControl>
                  <FormControl margin="normal" required fullWidth>
                    <InputLabel htmlFor="password">Confirmation mot de passe</InputLabel>
                    <Input
                      id="inputFileRegister"
                      onChange={this.onChange}
                      value={this.state.password2}
                      error={errors.password2}
                      name="password2"
                      type="password"
                      className={classnames("", {
                        invalid: errors.password2
                      })}
                    />
                    <span className={classes.errorText}>
                      {errors.password2}
                    </span>
                  </FormControl>
                  <Button
                    type="submit"
                    fullWidth
                    variant="raised"
                    color="primary"
                    className={classes.submit}
                  >
                    cree compte
              </Button>
                </form>
                <Typography className={classes.footer} variant="body1">
                  {'Déjà un compte? '}
                  <NavLink to="/login" className={classes.link}>
                    Se connecter
              </NavLink>
                </Typography>
              </Paper>
            </main>
          </React.Fragment>
        </div>
        );
      }
    }

Register.propTypes = {
          registerUser: PropTypes.func.isRequired,
        auth: PropTypes.object.isRequired,
        errors: PropTypes.object.isRequired
      };

const mapStateToProps = state => ({
          auth: state.auth,
        errors: state.errors
      });

      export default compose(withStyles(styles),connect(
        mapStateToProps,
  {registerUser}
        ))(withRouter(Register));
